import FrameWorkItem from './FrameworkItem';
import jsonData from '../data/data.json'; 
import swiftLogo from "../assets/swiftLogo.png";
import pythonLogo from "../assets/pythonLogo.png";
import kotlinLogo from "../assets/kotlinLogo.png";
import javascriptLogo from "../assets/javascriptLogo.png";
import sqlLogo from "../assets/sqlLogo.png";
import htmlLogo from "../assets/htmlLogo.png";
import typescriptLogo from "../assets/typescriptLogo.png";
import "../styles/LanguageList.css"; 

function FrameworkList() {
  return (
    <div className="language-list">
      {jsonData.frameworks.map(framework => (
        <FrameworkItem
          key={framework.name}
          logo={getLogo(framework.name)}
          name={framework.name}
          linkGithub={framework.linkGithub}
          linkCertif={framework.linkCertif}
        />
      ))}
    </div>
  );
}

function getLogo(frameworkName) {
    switch (frameworkName) {
      case 'Swift':
        return swiftLogo;
      case 'Python':
        return pythonLogo;
      case 'Kotlin':
        return kotlinLogo;
      case 'Javascript':
        return javascriptLogo;
      case 'SQL':
        return sqlLogo;
      case 'HTML5 et CSS3':
        return htmlLogo;
      case 'TypeScript':
        return typescriptLogo;
      default:
        return null;
    }
  }
export default FrameworkList;
